import React from 'react';
import { Box, Button, Header } from "@chakra-ui/core";
import { styled } from "../theme";

const Wrapper = styled(Box)({
    width: "100%",
    height: "100%"
})
export const Homepage = () => {
    return <Wrapper>
        <Header>FYSP</Header>
        <Button>Start</Button>
    </Wrapper>
}
